import Layout from "../layout";

function Cart() {
  return (
    <Layout>
      <div className="w-3/5 pt-10 m-auto">
        <div className="flex justify-between">
          <div>
            <h3>Bag</h3>
          </div>
          <div>
            <h3>Summary</h3>
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default Cart;
